import React from 'react';
import { Card, CardBody, Row, Col, CardImg } from 'reactstrap';

const Listing = props => {
    return (
        <>
            <Row>
                <Col md={{size: 10, offset: 1}}>
                    <Card>
                        <CardBody>
                            <Row>
                                <Col className="listing-pic" xs='4'md='2' align='center'>
                                    <CardImg className="card-img" top src={props.info['PictureURL']} alt="airbnb listing picture" />
                                </Col>
                            </Row>
                        </CardBody>
                    </Card>
                </Col>
            </Row>
        </>
    )

}

export default Listing;
